import React from "react";
import DeckListItem from "./DeckListItem";

function DeckList({ decks }) {
    return (
        <div className="list-group">
            {decks.map((deck) => <DeckListItem key={deck.id} deck={deck} />)}
        </div>
    );
}

export default DeckList;
